import React from 'react';
import { Col, Row } from 'react-bootstrap';
import './Text.css';

export default function Text ({tamanio, encabezado, titulo, complemento}) {
    return (        
        <Col sm={tamanio} className="Text">
                <h3> <small> <h4> {encabezado} </h4> </small> <br></br> 
                 <a href=""> {titulo}     </a>
                 <div className="blockquote">
                    <small> {complemento} </small>
                 </div>
                </h3>       
        </Col>                    
    )
}
